{-# LANGUAGE DeriveDataTypeable, DeriveGeneric, DeriveAnyClass    #-}

module Auxiliary.Tree (
    Tree(..), eqTree,
    bigTrees, bigTree,
    smallerTrees, smallerTree,
    seqTree, mapTree,  tweakRightmost
  ) where

import Data.Generics hiding (Generic)
import System.Random

import Control.Parallel

import GHC.Generics
import Control.DeepSeq

-- Tree datatype
data Tree a = TLeaf a | Bin (Tree a) (Tree a) deriving (Typeable, Show, Eq, NFData, Generic, Data)


eqTree :: Tree Int -> Tree Int -> Bool
eqTree (TLeaf x1)      (TLeaf x2)         = x1 == x2
eqTree (Bin l1 r1) (Bin l2 r2) = eqTree l1 l2
                                                && eqTree r1 r2
eqTree _              _              = False

-- Fully seq a Tree
seqTree :: Tree a -> b -> b
seqTree (TLeaf x) b   = x `seq` b
seqTree (Bin t1 t2) b = (seqTree t1 (seqTree t2 b))

-- Map on a Tree
mapTree :: (a -> b) -> Tree a -> Tree b
mapTree f = go
    where
        go (TLeaf x)      = TLeaf (f x)
        go (Bin l r) = Bin (go l) (go r)

-- Tweak the rightmost element of a Tree
tweakRightmost :: Tree Int -> Tree Int
tweakRightmost (TLeaf x) = TLeaf (x + 1)
tweakRightmost (Bin l r) = Bin l (tweakRightmost r)


genTree :: [Int] -> Tree Int
genTree []    = TLeaf 0
genTree [x]   = TLeaf x
genTree (h:t@(_:_)) | even h = Bin (genTree t) (genTree (tail t))
                    | odd h  = Bin (genTree (tail t)) (genTree t)


-- Big trees (size 1542685, 36924 even labels, 477304 odd)
bigTrees :: [Tree Int]
bigTrees = [bigTreeGen seed | seed <- [123456789..223456789]]

bigTreeGen :: Int -> Tree Int
bigTreeGen seed = genTree . take 30 $ randomRs (0,100) (mkStdGen seed)

bigTree :: Tree Int
bigTree = head bigTrees

bigTreeString :: String
bigTreeString = error "bigTreeString" --gshow bigTree

-- Smaller trees
smallerTrees :: [Tree Int]
smallerTrees = [smallerTreeGen seed | seed <- [123456789..223456789]]

smallerTreeGen :: Int -> Tree Int
smallerTreeGen seed = genTree . take 26 $ randomRs (0,100) (mkStdGen seed)

smallerTree :: Tree Int
smallerTree = head smallerTrees

